let videos,
  videosCategoryTemp,
  videosCategoryTemp2,
  searchVideosContent,
  containerFilterSelected = $("#content-choses"),
  containerVideos = $(".playlistRowInsert"),
  searchInput = document.querySelector("#searchVideosByName"),
  typeCategory = "all";
currentPage = "playlist";

let filterPlaylistTypes = {
  All: "",
  Academic: ["All", "First Year", "Second Year", "Third Year", "Fourth Year"],
  Programming: [
    "All",
    "C",
    "C++",
    "Java",
    "Python",
    "HTML",
    "CSS",
    "JavaScript",
    "Php",
  ],
};

(async function () {
  let responseVideos = await fetchNews("js/data/play.lists.json");
  
  videos = responseVideos.playlists.articles;

  searchVideosContent = videos;
  arrayOfSomeItems = videos;

  parentItemsShow = containerVideos;

  repairPagination(searchVideosContent);
  showVideos();
})();

searchInput.addEventListener("keyup", () => {
  let inputValue = searchInput.value.toLowerCase();

  let filteredVideos = searchVideosContent.filter(function (objData) {
    let findData =
      objData.createdBy?.toLowerCase().includes(inputValue) ||
      objData.namePlaylist?.toLowerCase().includes(inputValue) ||
      objData.nameSubject?.toLowerCase().includes(inputValue);

    return findData;
  });

  containerVideos.html("");
  arrayOfSomeItems = filteredVideos;
  checkVideos(filteredVideos);
  if (numberClicked != 1 && numberBtn != 1) {
    repairPage("first");
  } else {
    repairPage("current");
  }

  repairPagination(arrayOfSomeItems);
});

